import React, { Suspense, useRef, useMemo, useState } from "react";
import { Canvas } from "react-three-fiber";
import { GLTFLoader } from "three/addons/loaders/GLTFLoader";
import { OrbitControls } from "@react-three/drei";
import "./App.css";
import { useLoader } from "react-three-fiber";
const RubiksCubeModel = ({ nodesSubset, drag, onDragChange }) => {
  const cubeRefs = useRef([]);
  const orbitRef = useRef();
  const startYRef = useRef(0);
  const initialRotation = [Math.PI / 6, Math.PI / 4, 0];
  const groupRef = useRef();

  const handlePointerDown = (event) => {
    onDragChange(false); // Set drag state to false when pointer down
    startYRef.current = event.clientY;
    window.addEventListener("pointermove", handlePointerMove, { passive: true });
    window.addEventListener("pointerup", handlePointerUp, { passive: true });
    event.stopPropagation();
  };

  let deltaY;

  const handlePointerMove = (event) => {
    const startY = startYRef.current;
    if (startY !== null) {
      deltaY = event.clientY - startY;
    }
  };

  let targetRot = 0;

  const handlePointerUp = async () => {
    window.removeEventListener("pointermove", handlePointerMove);
    window.removeEventListener("pointerup", handlePointerUp);
    if (deltaY > 0) {
      cubeRefs.current.forEach((cubeRef) => {
        targetRot = cubeRef.current.rotation.z + Math.PI / 2;
      });
      DraggingDown();
      deltaY = 0;
    } else if (deltaY < 0) {
      cubeRefs.current.forEach((cubeRef) => {
        targetRot = cubeRef.current.rotation.z - Math.PI / 2;
      });
      DraggingUp();
      deltaY = 0;
    }
  };

  const DraggingDown = async () => {
    cubeRefs.current.forEach(async (cubeRef) => {
      while (Math.abs(cubeRef.current.rotation.z - targetRot) >= 0.001) {
        cubeRef.current.rotation.z += Math.PI / 10;
        await new Promise((resolve) => requestAnimationFrame(resolve));
        await new Promise((resolve) => setTimeout(resolve, 1));
      }
    });
    onDragChange(true); // Set drag state to true after dragging
  };

  const DraggingUp = async () => {
    cubeRefs.current.forEach(async (cubeRef) => {
      while (Math.abs(cubeRef.current.rotation.z - targetRot) >= 0.001) {
        cubeRef.current.rotation.z -= Math.PI / 10;
        await new Promise((resolve) => requestAnimationFrame(resolve));
        await new Promise((resolve) => setTimeout(resolve, 1));
      }
    });
    onDragChange(true); // Set drag state to true after dragging
  };

  return (
    <>
      <group
        ref={groupRef}
        scale={[0.3, 0.3, 0.3]}
        rotation={initialRotation}
        onPointerDown={handlePointerDown}
      >
        {nodesSubset.map((node, index) => (
          <primitive
            key={index}
            object={node}
            ref={(ref) => (cubeRefs.current[index] = { current: ref })}
          />
        ))}
      </group>
      <OrbitControls ref={orbitRef} enableRotate={drag} />
    </>
  );
};

const RubiksCube = () => {
  const { scene } = useLoader(GLTFLoader, "/rubikcube.gltf");
  const [drag, setDrag] = useState(true); // Initialize drag state

  const nodesSubset1 = useMemo(() => scene.children.slice(0, 9), [scene]);
  const nodesSubset2 = useMemo(() => scene.children.slice(9, 18), [scene]);
  const nodesSubset3 = useMemo(() => scene.children.slice(18, 27), [scene]);

  const handleDragChange = (newDrag) => {
    setDrag(newDrag);
  };

  return (
    <Canvas>
      <ambientLight />
      <Suspense fallback={null}>
        <RubiksCubeModel nodesSubset={nodesSubset1} drag={drag} onDragChange={handleDragChange} />
        <RubiksCubeModel nodesSubset={nodesSubset2} drag={drag} onDragChange={handleDragChange} />
        <RubiksCubeModel nodesSubset={nodesSubset3} drag={drag} onDragChange={handleDragChange} />
      </Suspense>
      <pointLight position={[10, 10, 10]} />
    </Canvas>
  );
};

export default RubiksCube;
